import { 
    IonContent,
    IonInput,
    IonItem,
    IonLabel,
    IonTextarea,
} from '@ionic/react';
import React, { FormEvent, useState } from 'react';
import { Header } from '../../components/header';

export const AddProduct: React.FC = () => {
    const [product, setProduct] = useState({
        title: undefined,
        price: undefined,
        image: null,
        description: undefined
    })

    const setValue = (event: React.FormEvent<HTMLIonInputElement | HTMLIonTextareaElement>) => {
        console.log('adsadsadas', 'event stat');
        console.log(event, 'event');
        // setProduct({
        //     ...product,
        //     [event.target.name]: event.target.value
        // });
    }

    return (
        <>
            <Header
                title={'Add product'}
                key={'AddProduct'}
            />
            <IonContent>
                <div>
                    <IonItem>
                        <IonLabel>Title</IonLabel>
                        <IonInput name="title" type="text" onChange={setValue} />
                    </IonItem>
                    <IonItem>
                        <IonLabel>Price</IonLabel>
                        <IonInput name="price" type="number" onChange={setValue} />
                    </IonItem>
                    <IonItem>
                        <IonLabel>Image</IonLabel>
                        <IonInput name="image" type="text" onChange={setValue} />
                    </IonItem>
                    <IonItem>
                        <IonLabel>Description</IonLabel>
                        <IonTextarea name="title" onChange={setValue} />
                    </IonItem>
                </div>
            </IonContent>
        </>
    );
}
